import React, { Component } from 'react';
import './App.css';
import CardsList from './CardsList';

class App extends Component {

  constructor(){
    super()
    this.state = {
      people1: "",
      people2: ""
    }
  }

  render(){
    return(
      <div>
        <CardsList />               
      </div>
    )
  }

  componentDidMount(){              
    fetch("https://swapi.co/api/people/1")
      .then(result => result.json())
      .then(data => console.log(data))                            
  }
}

export default App;
